// src/models/Post.js
class Post {
    constructor(id, title, shortDescription, content, bannerPath, author) {
      this.id = id;
      this.title = title;
      this.shortDescription = shortDescription;
      this.content = content;
      this.bannerPath = bannerPath;
      this.author = author;
    }
  }

  export default Post;
